<?php

use voku\helper\HtmlMin;

/**
 * Class HtmlMinTest
 *
 * @internal
 */
final class HtmlMinBigInputTest extends \PHPUnit\Framework\TestCase
{
    public function testIssue67() {
        $minifier = new HtmlMin();

        $origHtml = '<p data-foo="" class="b c  a">   </p><img   src="data:image/png;base64," />';

        $expectd = '<p class="a b c" data-foo=""></p><img src=data:image/png;base64,>';

        $compressedHtml = $minifier->minify($origHtml);

        static::assertSame($expectd, $compressedHtml);
    }
}
